export const Authenticate = () => {
  const auth = {
    isAuthenticated: false,
  }
  const logedInUser = JSON.parse(localStorage.getItem('logedInUser'))
  if (logedInUser && logedInUser.token) {
    // console.log('here')
    auth.isAuthenticated = true
  }
  return auth
}
